    {
      name: "Finance",
      image_url: ""
    },
    {
      name: "Accounting",
      image_url: ""
    },
    {
      name: "Design",
      image_url: ""
    }
  ];

  return (
    <div>
      <div className="divider"></div>
      <Hero />
      <div className="divider"></div>
      <div className="container m-5">
        <h5>Find a Project Category</h5>
        <projectCategoryCard />
      </div>
    </div>
  );
};

export default Main;
